pragma solidity ^0.4.24;
library SafeMath {
  using SafeMath for uint256;
  function multiply(uint256 _a, uint256 _b) internal pure returns (uint256) {
    if (_a == 0 || _b == 0) {
      return 0;
    }
    uint256 c = _a * _b;
    require(c / _a == _b);
    return c;
  }
  function divide(uint256 _a, uint256 _b) internal pure returns (uint256) {
    require(_b > 0);
    uint256 c = _a / _b;
    return c;
  }
  function subtract(uint256 _a, uint256 _b) internal pure returns (uint256) {
    require(_b <= _a);
    uint256 c = _a - _b;
    return c;
  }
  function add(uint256 _a, uint256 _b) internal pure returns (uint256) {
    uint256 c = _a + _b;
    require(c >= _a);
    return c;
  }
  function modulo(uint256 _a, uint256 _b) internal pure returns (uint256) {
    require(_b != 0);
    return _a % _b;
  }
  function dmultiply(uint256 _a, uint256 _b, uint256 _d) internal pure returns (uint256) {
    uint c = _a.multiply(_b).add(_d).divide(2).divide(_d);
    return c;
  }
}
